          <div class="col-md-3 mb-md-0 mb-3">
            {/* <!-- Links --> */}
            <h5 class="text-uppercase">Conatct</h5>

            <ul class="list-unstyled">
              <li>
                <a href="#!">Link 1</a>
              </li>
              <li>
                <a href="#!">Link 2</a>
              </li>
              <li>
                <a href="#!">Link 3</a>
              </li>

            </ul>
          </div>
          {/* <!-- Grid column --> */}
        </div>
        {/* <!-- Grid row --> */}
      </div>
      {/* <!-- Footer Links --> */}

      {/* <!-- Copyright --> */}
      <div class="footer-copyright text-center py-3">
        Â© 2020 Copyright:
        <a href="/"> MDBootstrap.com</a>
      </div>
      {/* <!-- Copyright --> */}
    </footer>
  );
};

export default Footer;
